import React from 'react'
import ReactDOM from 'react-dom'
import history from '../history'
x
const Modal = props =>{
	return ReactDOM.createPortal(
		<div onClick={() => history.push('/')}className="ui dimmer modals visisble active">
			<div onClick={(e)=>e.stopPropagation()}className="ui standars modal visisble active">
				<div className="header">Delete Stream</div>
				<div className="content">
					Are your sure you want to Delete this stream
				</div>
				<div className="actions">
					<button className="ui primary button">{props.title}</button>
					<button className="ui button">Cancel</button>
				</div>
			</div>
		</div>,
		document.querySelector('#modal')
	);
};

export default Modal;
